import StudyTask from '@/views/studyTask/StudyTask';
import ResultPage from '@/views/resultPage/ResultPage';

const routes = [
  {
    path: '/studyTask',
    name: 'studyTask',
    meta: {
      title: '训练任务'
    },
    component: StudyTask
  },
  {
    path: '/resultPage',
    name: 'resultPage',
    meta: {
      title: '任务结果'
    },
    component: ResultPage
  },
  {
    path: '',
    redirect: '/studyTask'
  }
];

export default routes;
